INSERT INTO `5kcrm_oa_log` VALUES (1,2,'','本周拜访了四家企业，其中康立泰明确指出9月或10月份开始实施CSV工作。想让第三方给做一台难度较高的CSV，其它设备自己做。科兴化学原料药厂想等总部做了以后再实施。','跟进上周拜访的企业，着重联系一下科兴总部。再电话联系新客户。','在联系DBS的过程当中，客户会问都有哪些企业做过DBS系统，还有DBS单价看着性价比很高，但是几十台设备需要增加的端口费用太高。',11,1566615413,1566615413,',1,2,35,','',',11,1,35,2,'),(2,1,'','胡朝洋：已查看你的客户追踪，大部分是向客户询问CSV是否做了，公司产品较多，询问策略可有所改变，对于客户网络版的可以着重推荐CSV，单机版用户可询问客户备份策略？是用移动硬盘手动备份还是有自动备份的系统，我们可提供客户自动备份的解决方案，目前是针对单机客户端较多的用户比较好的产品。','尽量多了解客户的需求，然后根据客户的需求给客户出解决方案！','',1,1566741286,1566741286,',2,4,5,8,9,','',',1,8,9,2,35,'),(3,1,'','学习演练dms数据管理系统，das偏差识别系统演练','','',13,1566984905,1566984905,'','',',13,1,35,2,'),(4,2,'','本周的工作内容，跟进老客户+联系新客户+DMS/DAS实际操作演练。其中为康立泰药业有限公司拟定了项目计划书。沟通益康第三笔款项问题。','和益康具体落实第三笔款项，在公司联系客户。','哪些客户需要拜访的准确度拿捏不好。我原来是做本地销售，人在北京，客户也在北京，当时是联系上客户就预约拜访，建立初步联系。之前的企业也是对于拜访有要求，鼓励多拜访。我不确定咱们的客户如果没有做过相关项目，比如说客户目前是单机版，我们可以推网络版或者数据自动备份包括验证，但是客户还没有明确的需求时，我们是否就可以预约拜访，还是等到客户想做了有预算时我们再进行拜访，就是这个拜访的度总是掌握不好，因为毕竟差旅费也是公司投资在我们身上比较大的支出。',11,1567152499,1567152499,',1,2,35,','',',11,1,2,35,'),(5,2,'','本周和潘二宝老师出差，详细内容如下：\n8月26日，安徽华威药业，无菌滴眼剂的审计，预计明年六月份审计。合作方式：一次无菌审计，以及辅导其建立无菌管理及验证等。\n8月27日，江西博雅欣和，此公司报上去的一致性品种，因石药欧意做了BE，所以打算放弃掉。\n                 江西亿友药业，一致性评价的审计，合同已经发过去了，价格3.8万，不含差旅。\n8月28日，岳阳新华达药业，一致性评价审计需要上报老板同意，报价六万，目前来看还是比较有意向的，网络版软件没有验证。\n8月29日，植物药业，一致性评价品种是5月报上去的，意向不是很强烈。\n                中国医学院生物学研究所，沟通了一下计算机化系统验证。\n8月30日，维和药业，会员制的一致性评价审计，主审内容是：实验室审计。\n8月31日，大理药业，送感谢费，并沟通了今年的情况，预计后续要做审计和质量体系完善。','下周的工作安排主要是对上周拜访的客户和签订的合同进行落实，并且对之前苏州班的意向客户进行对接。详细如下：\n 一、江西亿友药业的合同签订流程。\n 二、华威、博雅，新华达等企业意向继续对接。\n三、南阳新生制药的辅料变更和口服液增加规格进行对接。\n四、苏州班沟通的意向客户更近。','',8,1567324667,1567324667,'','',',8,2,1,35,'),(6,2,'','8月21-24日太原出差总结\n1.本次出差是去推进山西鑫煜药业的一致性评价工作进度，目前企业的水系统改造已经完成，实验室搬迁也已经完成，目前菅立军老师已经驻场服务，接了来CSV的合同还要继续增加几台，具体的等到实验室的老师驻场后，根据工作进度看。\n2.跟鑫煜的刘总沟通关于技术老师的差旅费报销的问题，目前已经解决。\n3.去山西宝泰药业有限公司拜访，他们目前的进度是原料药刚过完认证，GMP证书还没有拿到，山东创新那边的原料药研究还未开始，合同已签，还未付款。待原料药GMP证书到手，先生产，把资金盘活，启动山东创新的项目，等到山东创新的原料药研究透彻后，才会开始我们的一致性评价工作。\n4.山西宝泰药业的张立斌准备离职，做了6年的QC，6年的QA，2015年来的山西宝泰，消息我已经告诉王老师，王老师的意思是过段时间看是否可以招募。\n5.参加太原的培训班与山西云鹏药业的质量经理苏蓉沟通他们单位的一致性评价审计的事情。\n6.与晋阳制药厂沟通中秋后的DMS现场交流的时间，及现场的软件介绍。','下周工作安排\n1.与舒兰合成敲定FDA回复与体系建设合同细节，需要去一趟舒兰。已抢到9月3号的火车票\n2.与洮南敖东明确合同细节，具体看是否需要去白城。\n3.舒兰结束后去拜访吉林长源制药李总，他们需要采购一套DMS.\n4.看具体时间还需要找一下长春万通苑总，圣金诺张总，吃个晚饭。','无',14,1567391582,1567391582,',1,2,','',',1,35,2,14,'),(7,1,'','上周六和周本一一直在沟通益康回款的问题，周一周二晚上也一直联系满总，包括透漏回款后的公关费用，周三成功回款。周二到周五一直在公司联系客户，目前东营的企业已经联系完了，烟台的企业联系了一半，可以拜访有需求的企业有两家，看看下周或者节后去拜访。','联系烟台、威海、青岛周边的客户，预计节后一起多拜访几家。','本周没有遇到具体问题，如有问题及时向领导汇报。',11,1567754964,1567757214,',35,1,2,','',',11,1,35,2,'),(8,2,'','本周沟通客户如下：\n  一，拜访客户情况：\n      华威得等一两周继续沟通细节；博雅欣和的一致性评价确定放弃啦，考虑网络版验证；新华达得等老板批准；植物的一致性评价审计还在犹豫中；\n二、江西亿友合同情况：确定28,29两天审计客户。费用3.8万，差旅由客户承担。合同在邮寄中\n三、沟通的其他客户情况：\n     A、南阳新生的辅料变更和新增规格得继续保持沟通，\n     B、成都医路康原辅包审计，最后确定自己的朋友来审计。\n     C 、德昌祥的DMS网络版由于汉方集团需要内部重组，暂搁。\n     D、北大医疗的网络版和一致性评价需要后续上门沟通。\n     E、辽宁仙草堂的网络版打算自己做，推荐了备份系统。\n     F、安健药业打算考虑备份系统。\n     G、华森药业的FDA项目，需要做了差距分析了在考虑。\n     H、泰丰药业考虑备份系统。\n     I 、巢湖今辰的质量体系需要等亳州华佗的实施后去考察在决定。\n     J.泰丰的一致性评价现场核查过，单机版考虑备份系统。\n  \n\n     \n      \n','一、对海南三叶、海南日中天、海南天煌的等企业的一致性评价进行对接。\n 二、对云南区域合作的十几家老客户，贵州合作的七八家客户进行备份系统的推荐。\n 三、对岳阳新华达等上周沟通需要反馈的客户进行继续跟进。\n  四、对江西亿友附近的几家一致性评价客户进行对接，争取以点带面。','一、客户需要备份系统的详细介绍资料。',8,1567841111,1567841111,'','',',35,1,8,2,'),(9,2,'','周一：贵州济生CSV没有做，有意向请第三方，预计明年三语做；贵州飞云岭对DBS有意向。\n周二：贵州维康子帆对CSV有意向，约上门沟通交流，上门时间没有定；贵州家诚药业企业不具备做CSV的能力，后续继续沟通。深圳赛诺生有意向做实验室和生产上设备的验证，约上门交流沟通，时间定中秋节后，具体时间未定。\n周三：国药血液制品单机版CSV，今年没有计划，需明年报计划，分析意向不强；贵阳润丰只有CSV没有做，有的设备还没有审计追踪功能，后续沟通DMS和DBS；贵州远程制药跟踪检查数据备份有被指出问题，推DBS\n周四：重庆莱美药业岛津网络版CSV做了，注射剂高风险企业，可以沟通上产上设备的验证；上海浦津林州制药单机版CSV做的做的不太完善，推CSV和DBS，注射剂高风险企业还可以推上产设备的验证，后续继续沟通云南特安呐制药单机版CSV企业认为做的较好，03年老设备没有审计追踪功能，推DBS和DMS；云南金碧制药CSV单机版已做完，推DBS，有意向。\n周五：贵州宝芝林单机版CSV厂家做，对DBS意向不强，后续沟通CSV；贵州金宇药业单机版液相一台简单做了CSV，其余设备没有上计算机化系统。\n       本周内还联系了广东客户，单没有意向较强烈的。','9月8-10日参加成都培训班，9月11-13日联系广东客户，争取联系三四家意向客户，随赛诺生一起拜访。','',9,1567852750,1567852750,'','',',9,35,1,2,'),(10,2,'','领导好，本周（09.02-09.06）工作总结内容：\n1、每天打电话联系新老客户，介绍本公司软件产品及服务项目，尤其DBS自动备份系统软件。\n2、学习DMS、DAS软件操作方法（熟练），网上查找资料加强自身业务知识量。\n3、由于之前未参加本公司办公软件培训，导致自己不能及时更新每日沟通情况，出现了一些罚款。经周末竭老师培训后，已基本掌握办公软件。\n4、本周前电话联系的客户情况都已在新建客户的备注里，有所体现。下周以日志汇报每天工作情况。','1、继续打电话联系客户，有需求的建立商机，并在后期跟进。\n2、上周进行的培训，多看多听多查找进行吸收消化。\n3、主推DBS自动备份系统软件，沟通过程中有问题及时联系并反馈。\n4、联系翟老师，查找本公司以前培训的音频资料，进行学习。','1、软件产品及项目知识掌握的不够深。\n2、多参加公司培训，多学习，多沟通。',30,1567954842,1567954842,',35,14,2,1,','',',30,35,14,1,2,'),(12,1,'','胡朝洋关于参加2019成都市新药品管理法培训班的总结\n      班上客户沟通情况如下：\n1、四川汇宇制药：蔡刚，CSV单机版7/8台自己简单做了，自动备份系统有的设备自动备份，有的移动硬盘备份，对请第三方意向不太强，DBS意向也不强。生产注射剂，属于高风险企业。\n2、四川博仁药业：吴成智，CSV单机版5/6台简单做了，用移动硬盘备份数据，对请第三方做CSV和上DBS没有表现出较强的意向，后期继续沟通。饮片公司\n3、四川三叶草生物制药：许青松（负责QA、项目），网络版沃特世，实验室和车间设备均已与厂家做CSV，后期再严重可能会考虑第三方公司或者自己做。生物制品公司\n4、成都新恒创药业：黄奕嘉，网络版自己做的，车间设备验证也是自己做的，对第三方公司意向不强，分析：可能做的不太完善，后期继续沟通。生产口服剂型及原料药\n5、四川一康制药：张义，单机版CSV自己做了一些，数据备份是移动硬盘备份，一个硬盘对应一台设备，对第三方有考虑。中成药企业\n6、四川新开元制药：陈急翼，安捷伦网络版，自己有做，不考虑第三方。原料药生产企业，属于四川科伦子公司\n7、贵州维康子帆：质量部龙经理，对我们上门拜访提出：CSV项目，需要做些准备，最好在技术交流过后，能把这个项目确定下来，到底做还是不做。\n\n     作出如下总结：\n     对四川的客户不熟，客户对我也不熟，所以在会场与客户沟通时，有的企业都不愿跟我去过多的沟通，所以后期我需要加强对四川客户的沟通。\n     以上客户是在培训中场休息时间沟通的客户，因为我个人觉得在午餐时间或者下午下课后去和客户沟通的话需要比较熟的客户才好，目前四川的客户还比较生疏，所以没有在这个时间段去接触客户。','','',9,1568195023,1568195023,'','',',9,1,2,'),(13,1,'','                                                  一致性评价学习心得\n1、主要分两大部分：药学研究+BE试验/豁免；\n2、我公司主要做技术审评（现场核查这块）：（1）生产系统现场  围绕生产过程中生产工艺处方与申报材料一致性，近期的批生产记录及相应的物料发放记录。生产环境、设备、厂房设施是否符合生产要求，相关的工艺验证情况。（2）质量控制保证系统   现有的质量体系是否支撑检察员的检查。产品年度质量回顾（OOS、偏差、变更）、化验室分析方法的建立与验证、药品稳定性考察情况等等；\n3、有些申报一致性评价的企业（根据品种不同）无需进行现场核查这块。资料上报CDE在审评的过程中，发现问题、疑点或纸面上无法解决的问题会启动现场的核查，CDE转给审查中心抽调检察员去现场检查；\n4、中等偏上的企业有关技术转移的问题较薄弱，依赖CRO公司，包给CRO公司来做这一系列（药学研究、小试、中试）。但是CRO公司所提供的资料（处方工艺）是否符合你公司现有的质量体系、人员模式、设备状况等。后期会出现很多问题，CRO公司不会在管，企业投入大量的资金无法与之翻脸。\n','','',30,1568201752,1568201752,',35,2,','',',30,35,1,2,'),(14,1,'','                                                 如何跟客户建立信任感\n1、要认同客户说的。客户讲的不一定对，但是他认为对，我们要听他叙说。有重大有文献支持的不要去认同他，要提出来告诉他。\n2、去现场拜访客户。可以有见面礼物（小件），沟通中要赞美，多听他说。这个具体分客户具体对待。\n3、销售产品的专业知识。假如你没有完整的产品知识，客户一问三不知，会让客户失去信任感。\n4、彻底地了解客户的背景，才能很好地进行交谈沟通。\n','','',30,1568201826,1568201826,',35,2,1,','',',30,35,1,2,'),(15,1,'','                                                     DBS学习总结\n1、DBS数据备份系统性能安全可靠， 配有相应的服务器。（网络版）\n2、在化验室室仪器操作过程中，进行DBS数据备份意外中断，软件会有弹框提示，在启动时会断点续传，不会丢失数据备份。\n3、在进行数据备份过程中安全有保证，不会被未授权的用户访问、窃取，也不会遭到破坏、更改和信息泄露。\n4、不管您是什么设备什么型号什么厂家， 是色谱还是非色谱都可以统一管理。这款DBS数据自动备份软件支持多机热备功能。\n5、目前一套完整的DBS数据备份系统包含5个用户名、5个端口、DBS数据备份系统验证，实施技术现场安装、培训及指导。\n','','',30,1568201870,1568201870,',35,1,2,','',',30,35,1,2,'),(16,2,'','本周工作四天，电话联系的地区是烟台、威海、青岛，电话拜访的客户目前没有明确意向的。周三下午亚兰药业主动联系我，问及光谱升级审计追踪的事宜，周三晚上也和客户商量了一下报价，相对来讲比较靠谱。客户提出他们的光谱没有审计追踪，我也问及了如果签约实施的时间，客户回答越快越好。此客户是质量负责人，他上边直接是老板，收到项目计划书就会找时间和老板沟通这个事。','近一步跟进康立泰和亚兰药业。继续电话沟通威海，青岛等客户。青岛有一个蓝色医药产业园，里面很多研发公司，想办法弄一下资料，一起都联系一下。','DBS的功能比较了解，但是实际操作，包括查看方式不太明白。所以和客户介绍的可能不对，只介绍功能有些时候又感觉比较空洞。希望后期能实际操作，真正的会运用此系统，会和客户介绍的有血有肉，更加具体。',11,1568272965,1568272965,',1,2,35,','',',11,1,2,35,'),(17,2,'','孙志强本周工作内容概括如下：\n一、海南日中天一致性评价上周刚来过，数据可靠性目前查到不是很严格。\n二、海南天煌注射剂一致性在开始阶段，推荐备份系统。\n三、海南灵康推荐了备份系统。领导不是太在意。\n四，云南和创在做注射剂一致性评价，两个品种，推荐了备份系统。\n五，岳阳新华达一致性评价领导还没有批复。\n六、江西亿友审计过程中，空余时间需要安排江西施美药业和宫老师见面。\n七、九州通投资武汉普生的注射剂需要一致性评价审计。协调时间和老师。\n八、海南三叶的一致性评价在小试阶段，考虑一致性评价审计。\n九，河北羚锐后虚考虑lims。\n十、云南明镜考虑数据备份系统。本周总结如上。','一、需要对已经合作的云南客户没有沟通完成的继续推荐备份系统。如，圣火，天利，玉药和章凤制药厂。\n二、对上次推荐备份系统的客户需要领导确认的，继续跟进，如：仙草堂，安健、泰丰、和天长亿帆。\n三、确定好九州通一致性评价审计的时间和老师，必要时候可能周五出差。\n四、对公海客户进行挖掘需求和意向。\n','需要对重复录入的客户进行合并，对录入错误信息的客户，销售员需要反馈在跟进里面。并更改。',8,1568390085,1568390085,'','',',1,2,35,8,'),(18,2,'','本周周一周二在成都培训班，周三周四电话与客户沟通，没有较强意向的客户，主要联系的还是广东的客户，因为节后需到赛诺生技术交流，广东康臣药业有些意向，可推CSV、DBS，上门技术交流需提前联系客户，等具体时间确定下来了再联系康臣。','下周安排：重点先放在广东联系客户，联系有意向的三四家上门技术交流；其次放在成都班的客户，挖掘客户意向。','',9,1568447460,1568447460,'','',',9,1,2,35,'),(19,2,'','领导好，本周（09.09-09.12）工作总结内容：\n1、每天打电话联系新老客户，介绍本公司软件产品(DBS自动备份系统软件)及服务项目。\n2、学习DMS、DAS软件操作方法（熟练），网上查找资料、多听培训语音加强自身业务知识量。\n3、哈尔滨三联药业李主管对我公司DAS数据分析系统软件较感兴趣，节前发了下PPT及打电话简单说了下DAS优势（进行数据分析、做年中报告方面），节后那天电话沟通后方便去拜访下企业。\n4、辽宁格林药业李主任对我公司DBS数据备份系统软件较感兴趣，微信已发海报、一些优势。她那边说节后和她领导反馈下在电话联系。','1、继续打电话联系客户，有需求的建立商机，并在后期跟进。\n2、对于培训语音，多看多听多查找进行吸收消化。\n3、主推DBS自动备份系统软件，沟通过程中有问题及时联系并反馈。\n4、有意向的客户进一步沟通并进行上门拜访。','1、软件产品及项目知识掌握的不够深。\n2、多参加公司培训，多学习，多沟通。\n3、有关关联性审评方面的知识，需要进行学习。',30,1568552788,1568552788,',35,2,1,','',',30,2,35,1,'),(20,1,'','周一到周三参加820培训，周四至周日济南培训班出差准备、去程、报道，会务工作以及客户沟通。周二亚兰药业质量负责人和我沟通，说工作忙还没和领导汇报，打印出来抽时间和领导汇报一下。周五晚上我给亚兰打电话，说和领导说了一次，但是领导要出国，说回国再详细沟通。预计下周回国，回国后就找领导详细汇报。亚兰我去年就沟通过DMS的事，这次主动与我联系，还教我报价，应该非常有诚意。康立泰的王老师周三也和我联系了一次，问了一些技术方面的问题，我让吕高寒老师给出了解答，目前正在走流程。只不过康立泰的王老师没有做过相关工作，问题都很基础并且多，质量负责人王媛媛打电话总是无人接听，最早的时候联系过王媛媛一次，告诉我是王老师负责，目前只能一步一步往上走。','周一周二培训班帐目整理，甘肃出差的准备。周三至周六，甘肃培训班出差，周日整理培训班出差帐目。','',11,1568977431,1568978081,',1,2,35,','',',11,1,35,2,'),(21,1,'','                        胡朝洋关于2019年9月16日-20日未更新crm系统信息的说明\n尊敬的公司领导：\n       由于9月16日-20日在深圳赛诺生公司出差，9月16日上午出发去深圳，下午三点过到深圳，再到赛诺生公司附近找好住宿，时间已经是五点过，所以当日没有联系客户；9月17日-19日一直在赛诺生与客户沟通，没有与客户联系；9月20日中午十二点半从深圳出发返回贵阳，上午有时间与客户沟通，但因住宿的酒店房间属于内窗房，信号不好，与家人通电话时都听不清，所以当日上午也没有联系客户。\n       请公司领导审查！\n','','',9,1569050812,1569050812,'','',',9,1,35,2,'),(22,2,'','本周总结见附件','周一至周三：在办事处联系客户，在孙经理时间允许的情况下上门拜访贵州维康子帆，因贵州维康子帆明确表达需交流技术方面，我个人技术方面还是欠缺\n周四至周六：广州2019药品管理法解读培训班出差','',9,1569069871,1569069871,'','',',9,1,35,2,'),(23,2,'','竭老师： \n     您好！昨天晚上和同方药业的客户喝酒后，所以周报今天补上，如下：\n 一，海南海神同洲的一致性评价，下次去新世通的时候要与专家碰面。\n二、海南赞邦的BE重做，与何总介绍的山东则正沟通尚没有进度。\n三、海南灵康的csv验证，打算生产和实验室各做一台，目前没有好的契机提出来。\n四、江西回音壁东亚、江西施美和江西博雅欣和这几家中等亿友审计时候与专家碰面。\n五、重庆植恩11fda审计，csv还在考查。\n六、重庆华森的fda项目目前还没有动静。\n七、重庆北大医疗，安捷伦网络版，验证报价20多万。\n八、云南佑生、云南圣火推荐备份系统\n九、云南昆明中药已经上了备份系统。\n十、云南和创推荐了备份系统，一致性评价报价6万。\n十一、岳阳新华达报价6万，等老板答复。\n十二、贵州德昌祥DMS网络版暂停\n十三、桂林南药，湖北延安、辽宁仙草堂考虑备份系统。\n十四、湖北汇中和福建天人，考虑一台设备的CSV验证。\n','一、上周挖掘的海南、云南、重庆的意向客户继续跟进。\n二、同方药业的审计报告和后续的整改方案。（九州通合作）\n三、与九州通合作的武汉普生、海南新世通的一致性评价审计合同、日期沟通。\n四、与宫老师、娄老师、菅老师江西亿友的28/29号审计实施。\n五、本周大部分时间在公司继续挖掘和跟进客户。','',8,1569133297,1569133297,'','',',8,1,35,2,'),(24,2,'','本周与菅立军老师审计了山西晋阳制药厂，后期继续追踪，有可能，能上DMS单机版4台左右，计算机验证1-2台，DBS系统1套，具体要看方案，和老板是否同意。\n与于海勇见面沟通，让其帮助推荐山西省一致性评价企业需要做体系提升的客户。\n与杨峰见面沟通，鑫煜后期增加的计算机验证台数和计算机验证的台数。','下周周一至周四计划拜访南京的客户，从我大姐夫他那边的药厂买空压机的资源转化，不知道是否能有效，先尝试一下。\n姓名：南京易亨制药蒋正友副经理 手机：13814190827；\n姓名：药科大崔经理领导权经理 手机：18051007209；\n姓名：中科药业李磊 手机：15996363981；\n姓名：南京新百药业动力主管杨佟 手机：15850769332；\n姓名：恒生制药工程部章建 手机：13814148581；\n姓名：恒生制药采购余凯 手机：13951929474；\n以上是部分他的客户的资料，下周计划带我过去，见面拜访。\n周四晚上去合肥，27-29日参加合肥的培训班。','无',14,1569155338,1569155338,',2,1,','',',1,35,14,2,'),(25,2,'','周一到周三参加８２０培训班。周四周五在公司联系客户，','周一到周二请假　。周三到周五参加广州培训班。','',6,1569159424,1569159424,'','',',6,35,2,1,'),(26,2,'','9月23日请假\n9月24日在公司上午和孙志强老师学习探讨，下午联系河南培训班客户  梳理\n9月25日上午联系河北客户制定河北下一个培训班课题内容，下午王北京出发坐车到河南培训班出差\n9月26日 郑州培训班出差 协助培训班报道  和西安力邦制药有限公司  河南鼎昌药业有限公司  上海迪冉郸城制药有限公司 商丘金马药业有限公司  海南制药厂有限公司制药一厂  沟通一致性评价及数据完整性和计算机化系统验证，\n9月27日 开课第一天  和郑州安图生物工程股份有限公司  西安京西双鹤药业有限公司 山西云鹏制药有限公司  河南羚锐制药股份有限公司信阳分公司  上海锦帝九州药业（安阳）有限公司  沟通一致性评价及数据完整性和计算机化系统验证\n9月28日   河南天方药业中药有限公司  郑州瑞康制药有限公司 河南中帅药业有限公司 河南中帅药业有限公司 上海凯宝新谊（新乡）药业有限公司  沟通一致性评价及数据完整性和计算机化系统验证，\n9月29日  河南回北京  回燕郊','9月30日   回访一下河南培训班上的参会客户，依照调差表一对一沟通下具体意见和建议  以及对我们的产品的意向和想法   看能不能挖掘后期的合作，\n10月1-7日放假 ','一致性评价通过上次宫老师的培训  从技术转移切入效果不错，就是谈到CMO公司还是缺乏了解程度，放假期间多听听宫老师的培训录音   多上午查阅一下。企业大多数都是单机版  对于数据自动备份系统大家都只是感兴趣而已   不知道该如何进一步沟通，因为法规好像没有要求要自动备份。企业现在意识不到数据丢失的可怕性  希望我们对于DBS的介绍能有一个详细一点的，最好能有一俩个案例讲解效果会更好一点。  ',7,1569636440,1569636440,'','',',7,35,2,'),(27,1,'','周一回程休息，周二把济南的培训班所有账目结算。周三至周日甘肃培训班出差，包括所有的会务工作，以及和客户建立初步联系，挖掘需求。本周跟进的客户进度如下：1、和亚兰药业张总近一步沟通，了解项目进展的情况，这几天在培训班学习，马上放假了，节后走法务流程，预计没有什么问题的话在二十号左右就能签约了。这个项目他们也着急，因为他们扩展的新客户对于他们的审计后提出的要求，所以希望签约后能进快的实施。2、康立泰也近一步和王老师沟通了一下，问她现在项目的进展，领导有哪方面的指示？她反馈最近太忙，应该会放到十月份开展这方面的工作。我也引导她，即然有这个打算，最好是抽空提前完成，早合规同时会规避很多风险。她回复主要是工作太忙 ，实在没有时间。节后近一步沟通。','周一整理、结算甘肃班所有的帐目。节后继续跟踪这两家客户，以及把上个周期判定可以近一步跟进的客户整理出来，近一步跟进或者是拜访。最后把济南、甘肃培训班所有的客户再电话沟通一次，了解目前的情况，分析需求。','上周参加820的培训，其实还是挺有收获的，但是百学不如多练习，练习多了，才是真正的学到了，学会了。同时我也认为自己或者公司的新人，不成熟的销售也欠缺这部分的内容。我根据公司提供的内容，也试着写了一套产品的介绍，但是总感觉还没有说到客户的骨子里，还没有说到听完我的介绍，就会很想买的地步。还有就是销售故事，因为我的经验少，案例少，所以也希望公司有好的案例故事，可以分享出来，我或者是新来的销售可以直接复制，变成我们自己的故事。接下来，我对于820落地的内容，主要是想分为两方面落地，第一就是系统的整理，编写每个产品的介绍，这个过程一定是很漫长的。因为咱家的产品太多，我只能按照主次来写，由于自己的能力与技术了解的局限性，如果公司能有专人去写这种给客户介绍10分钟的产品介绍固然好，但是没有人来整理，来写的话，那我自己就尝试着写。只是中间穿插的销售故事，我希望是公司真实的案例，能触动客户的案例，我认为这样会更加深刻。第二写好了，有了好的产品介绍和销售故事不是最重要的，重要的是把好的产品介绍能够很自然的，很熟悉的和大家讲出来才是最重要的。那么现在我有一套820老师修改后的产品介绍，所以现在的任务就是能够很流利的把这个介绍很自然的讲出来，才是我目前最应该落地的内容。我会通过录制视频的方式，不断的讲解和练习，以及激励自己。后续我希望公司可以提供更多便于像我这种不成熟的销售可以复制的内容。',11,1569655143,1569655538,',35,1,2,','',',11,1,35,2,'),(28,1,'','今天和宫老师、娄老师，菅老师在江西亿友江西一致性评价审计第一天，品种信息：吡拉西坦片，目前发掘的意向是：一、实验室色谱的计算机化系统验证和CSV体系建立。二、技术转移体系建立。三、水系统、空调系统的验证。','明天对江西亿友审计第二天。主要内容如下：一、对江西亿友江西一致性评价的迎检技巧进行介绍。二、对技术转移和风险评估进行讲解，三、对两天的审计做一个汇报总结。','',8,1569669349,1569669349,'','',',8,1,35,2,'),(29,2,'','公司领导您好!本周总结如下：\n1、成都蜀西制药：CSV赛默飞网络版已由厂家做，后期有其他外包业务会考虑我们\n2、上海浦津林州制药：在新建生产线，验证已签厂家，后期看验证情况不好，会考虑我们\n3、贵州科顿制药：单机版做了一部分，CSV暂时不考虑\n4、贵州黄果树立爽药业：CSV方面重视不够，觉得没有硬性要求，暂时没有需求，后期继续沟通\n5、云南金碧制药：CSV单机版已做完，推了DBS，客户有意向DBS\n6、四川汇宇制药：CSV已过欧盟认证，后期看还有没有合作的项目\n7、贵州百灵集团：单机版35/36台，厂家做了3Q，后期跟进\n8、贵州苗仁堂制药：该公司搬迁，手续没有办理完全，目前不考虑业务\n9、惠州大亚制药：有部分设备升级审计追踪功能不太好，也不愿意再花钱用第三方软件，对CSV也暂时不考虑，后期继续跟进\n10、贵州神奇药业：目前神奇集团细致整合方面还没有完成，CSV没有提出相关计划\n11、贵阳润丰制药：单机版CSV自己做的，有的没有审计追踪功能，推DMS和DBS，后期跟进','1、联系深圳赛诺生汇款情况\n2、继续跟进意向客户及挖掘客户\n3、贵州维康子帆药业上门拜访时间推迟至国庆节后','参加培训班以后，分到的客户信息，电话沟通后，没办法在CRM里面更新信息，因为该企业信息已存在，这个问题怎么去解决呢？',9,1569750724,1569750724,'','',',9,35,2,'),(30,2,'','                                  2019广州药品管理法解读培训班总结报告\n尊敬的公司领导：\n通过参加培训班在现场与客户沟通情况，作出如下报告：\n1、广东彼迪药业有限公司副总：司徒卫彤13828060752\n该公司网络版CSV，自己简单做了一些，如需要请第三方做CSV，需要换掉老设备以后\n\n2、广州倍绣生物技术有限公司质量部：卢志坚13570294913\n该公司单机版CSV，自己做的，首先考虑集团的资源，再考虑第三方（该公司属于美国强生子公司）\n\n3、广州玻思韬控释药业有限公司QA：吴晓燕15622157560\n该公司两个网络版，沃特世和岛津，都由厂家和自己的验证部门做的，不考虑第三方公司\n\n4、广东华晟中药饮片有限公司副总：黄汉林18934003392\n岛津单机版，厂家一起做的，对第三方CSV方面暂时没有需求\n\n5、广东九明制药有限公司质量经理：韩尚学18520163619\n单机版2/3台，CSV没有做，后期继续跟踪\n\n6、贵州天源堂生物医药控股集团股份有限公司质量部：殷存龙18685133165\n该公司新成立企业，目前还在办生产许可证，后续跟他GMP认证、验证等服务\n\n个人总结：在参加培训班与客户沟通的过程中，我觉得我要改变一下方式，之前都是了解客户情况以后就问客户对第三方有没有需求，我觉得这样非常的不好。我认为，在班上需要做的就是了解客户基本情况和给客户留下好的印象就可以了，至于客户需求方面可以后期继续沟通。','','',9,1569752319,1569752319,'','',',9,35,2,'),(31,1,'','9月29日，今天在江西亿友审计一天，挖掘意向有：一、客户有考虑日本游学的想法，二、客户考虑企业内训。','','',8,1569801354,1569801354,'','',',8,35,'),(32,2,'','一、对江西亿友江西了为期两天的一致性评价审计，目前挖掘的意向有：1、技术转移体系建立，2、计算机化系统体系建立与验证。3、清洁验证、工艺验证和设备设施验证。4，企业内训。\n二、与宫老师一起对江西施美沟通了一致性评价审计，报价6万。不含差旅， 目前对方懂事已经同意，节后落实合作时间及技术老师。\n三、同方药业的审计报告交付，以及DMS网络版已经口头报价，等领导批准。\n四、普生药业的时间是10月12/13两天，新世通的时间定在11月。\n五、周一在北京接待了海南海灵质量黄总。\n六、云南生物谷推荐了备份系统。\n七、广西玉林药业目前网络版软件，验证考虑先自己做。\n八、安徽丰原涂山一致性评价已经通过。\n九、重庆天圣药业都是单机版，推荐了备份系统。\n十、江西回音壁东亚是注射剂一致性评价，目前项目才启动。目前江西抚州共计有四家企业在做一致性评价，分别是：江西亿友、江西施美，江西博雅欣和、江西回音壁东亚。','','',8,1569802709,1569802709,'','',',8,35,2,'),(33,2,'',NULL,'一、对同方药业的网络版方案、报价确定，并争取合同签署。\n二、对江西施美的进一步落实，争取签订合同。确定审计日期。\n三、10月10日，周四，去武汉拜访九州通客户，对其在广东、山东和江西等地投资的客户争取进行一致性评价审计。\n四、周五对武汉普生进行一致性评价现场核查审计，参与老师有宫老师，王彦忠老师和菅老师\n五、对上周跟进的客户继续跟踪。\n六、对武汉普生周边的客户继续挖掘，梳理一致性评价的客户，争取一点带面。全面铺开。','',8,1569802975,1569802975,'','',',8,35,2,'),(34,2,'','本周拜访了南京新百药业有限公司；南京中科药业有限公司；南京恒生制药有限公司；南京易亨药业有限公司，以上都是资源转化过来的客户，切入口都是设备动力部或是工程部，采购部等，对于计算机验证，咨询的内容还是了解甚少，或是没有直接的话语权，后期还是依此为突破口，转到质量部门上去，还需时间培育，如果能有质量的资源过来也是一个很好的选择。\n本周跟进了舒兰合成的CSV和483警告信批次的回顾增加合同项，还在谈。\n跟进了洮南敖东的DAS,DBS,CSV，CSV体系等合同，预计还要在过去一趟才可以。\n跟进了轩竹医药的审计，预计节后签约，执行时间定在10月26、27。\n跟进了万通药业总部的灾备系统，和生产设备的CSV，约了10月14左右和竭老师现场去看。','下周的工作内容就是十一假期后了。\n8-10号在云鹏审计\n11号去长春，12-13号在长春培训班，13号晚上去吉林。\n14-15号在吉林的培训班上，有可能14号去通化万通总部谈灾备系统，具体到时看。\n16-17号审计长春卓谊，哈尔滨医大，实验室审计，\n18号去牡丹江恒远药业，谈CSV验证，具体等对方节后给消息。\n18号晚上牡丹江赶到通化。\n19号万通药业总部内训，','南京的药厂客户，质量部门的资料请给我一份，谢谢！',14,1569804927,1569804927,',2,1,','',',35,2,'),(35,2,'','９月２５日－９月２９日参加广州培训班，联系了哈尔滨康隆药业刘总，跟进ＷＭＳ系统验证的进度。目前企业考虑到费用问题。可能会推迟项目时间，之前的报价除给到刘这边的费用外。在上次报价的基础上也做出了相应的调整。等节后企业回复\n　　　甘肃普安因许可证过期的事，现在一直回没明确回复。现宋老师电话沟通过一次，因为他们目前在忙别的事情。节后在打电话联系下。\n　　　河南浴松源因新的车间在建。牛老师把之前几台没有做的设备又从新报了一次。','','',6,1569892407,1569892407,'','',',6,');
